pragma solidity ^0.8.0;

contract DataStorage {
    address public ownerSmartContract;

    // 1 wei = 0.000000000000000001 ETH
    // 1 ETH = 1e18 wei
    uint256 public commissionInWei;

    mapping(address => bytes) public data;

    event DataUpdated(address indexed sender, bytes newData);

    modifier onlyOwnerSmartContract() {
        require(msg.sender == ownerSmartContract, "[NOT AUTHORIZED] You are not ownerSmartContract");
        _;
    }

    constructor(address _ownerSmartContract, uint256 _commissionInWei) {
        ownerSmartContract = _ownerSmartContract;
        commissionInWei = _commissionInWei;
    }

    function createOrUpdateData(bytes memory newData) external payable returns (bool) {
        require(msg.value > 0, "Payment required for data update");
        require(msg.value >= (commissionInWei * newData.length), "The commission amount must be no less than '(commissionInWei * newData.length)'");

        data[msg.sender] = newData;
        emit DataUpdated(msg.sender, newData);

        payable(ownerSmartContract).transfer(msg.value);
        return true;
    }

    function getData() external view returns (bytes memory) {
        return data[msg.sender];
    }

    function setCommissionInWei(uint256 newCommissionInWeiValue) public onlyOwnerSmartContract returns(bool) {
    	commissionInWei = newCommissionInWeiValue;
        return true;
    }

    function getCommissionInWei() external view returns (uint256) {
        return commissionInWei;
    }
}
